import React from 'react'
import { Link } from 'react-router-dom';
function Navbar() {
  return (
    <Navbar>
        <Container>
            <Navbar.Brand as={Link} to="/">Employee Management System</Navbar.Brand>
        </Container>
    </Navbar>
  )
}

export default Navbar
